  false,\n\t\"url\": null,\n\t\"notes\": \"Conclusions to evaluation:   Water supply
  appears to be adequate for present and future water requirements.  The legality
  of South Fork Pit River diversions and the status of North  Fork Pit River diversions
  have yet to be determined and will probably  require court action.  Ground water
  is available for supplemental refuge needs in adequate  quantity and quality.  Other
  than storage rights on the South Fork Pit River, no additional  unappropriated water
  is available.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
